result:
query posts($id: ID!, $name: [String]) {
  categories: blogCategory(id: $id) {
    name
    path
  }
  posts: allContentfulBlogPost(sortBy: "date", order: ASC, filter: {
      categories: {
        contains: $name
      }
    }
  ) {
    edges {
      node {
        title
        slug
        featuredImage {
          file {
            url
          }
        }
        content
      }
    }
  }
}
